import React from "react";

export default function Todo(todo){

    console.log("inside todoHead : "+todo);

    return(
        <>
            {todos.map(todo => 
                                        <tr>
                                            <th scope="row">{todo.id}</th>
                                            <td>{todo.headline}</td>
                                            <td>{todo.description}</td>
                                            <td>edit | delete</td>
                                        </tr>
                                    )}
        </>
    )
}
